import React, { Component } from 'react'
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import IconButton from '@material-ui/core/IconButton'
import MenuIcon from '@material-ui/icons/Menu'
import SearchIcon from '@material-ui/icons/Search'
import InputBase from '@material-ui/core/InputBase'
import '../App.css'
import keep_icon from '../svg_icons/keep_icon.png'
// import listView from '../svg_icons/listview.svg'

import LeftDrawer from './LeftDrawer'
import Redirect from 'react-router-dom/Redirect'
// import GetAllNotesComponent from './GetAllNotesComponent';
import MenuComponent from './MenuComponent';
import AddNoteComponent from './AddNoteComponent';
import NoteSection from './NoteSection';
import NoteService from '../services/NoteService';



const get_NotesAll = new NoteService().getNotesAll
const getArchiveNotes = new NoteService().getArchives




export class DashboardComponent extends Component {
    constructor() {
        super();
        this.state = {
            open: false,
            anchorEl: null,
            menuOpen: false,
            redirect:false,
            notes:[],
            common:[],
            archives:[],
            trash:[],
        }
        this.leftDfun = this.leftDfun.bind(this)
    }

    componentDidMount(){
        this.noteGetFunc();

        if (sessionStorage.getItem('userdata')){
            console.log("call user feed")
        }
        else{
            this.setState({redirect:true})
        }
    }

    leftDfun = event => {
        this.setState({
            open: !this.state.open
        })
    }

    signOut=()=>{
        this.setState({redirect:true})
    }



    noteGetFunc = e =>{
    get_NotesAll()
    .then(res =>{
        this.setState({
            notes:res.data.data
        })
    })

    .catch(error =>{
        console.log("error data", error.response.data)

    })
    }


    ClickSec=(data)=>{
        this.setState({
            common:data
        })
       console.log("common",this.state)
    }

    ArchiveGet=()=>{
        this.setState({notes:[]})
        getArchiveNotes()
        .then(res=>{
            this.setState({notes:res.data})
        })
        .catch(error=>{
            console.log("error archive ", error.response)
        })
    }

    TrashGet=()=>{
        this.setState({notes:[]})
        getTrashNotes
    }

    render() {

        if(this.state.redirect){
            return (<Redirect to={'/login'}/>)
        }

        return (
            <div className='root' id="main">
                <AppBar position="fixed" color="default">

                    <Toolbar className='ToolBar' >

                        <IconButton  onClick={this.leftDfun} edge="start" color="inherit" aria-label="menu" >
                            <MenuIcon  />
                        </IconButton>

                        <div className='imgFundoo'>
                            <div>
                                <img src={keep_icon} alt='keep_icon'></img>
                            </div>
                            <div className='icon'>
                                <p>fundooNotes</p>
                            </div>
                        </div>

                        <div className='search'>
                            <InputBase
                                className="InputBase"
                                placeholder="Search" />

                            <div className='searchIcon'>
                                <SearchIcon />
                            </div>


                        </div>

                        <MenuComponent signOut={this.signOut} />
                    </Toolbar>

                </AppBar>
                <LeftDrawer ArchiveGet={this.ArchiveGet} open={this.state.open} ClickSec={this.ClickSec}/>
                <AddNoteComponent noteGetFunc={this.noteGetFunc} />
                <NoteSection  ArchiveGet={this.ArchiveGet} noteGetFunc={this.noteGetFunc} note={this.state.notes}/>

            </div>
        )           
    }
}

export default DashboardComponent
